import React, { Component } from 'react';
import Navigation from './Navigation';
import savings from '../assets/savings.png';
import '../styles/Savings.css';
import data from '../wtso.json';
import axios from 'axios';
import cheerio  from 'cheerio';

class Savings extends Component {

    constructor(props){
        super();
        this.state = {
            wtso: ''
        }
    }
    componentDidMount(){
        this.setState({wtso: data.text})
        console.log(this.state.wtso);
        axios
        .get('https://www.wtso.com/')
        .then((response) => {
            const $ = cheerio.load(response.data);
            let title = $("title").text();
            let src = $('#current-offer-bottle-image').attr().src;
            console.log("Image: " + src);

        })
        .catch((err) => {
            console.log(err);
        });

    }


    render() {
        let header = "SAVINGS";
        return (
            <div>
                <Navigation header={header} />
                <img id="savings" src={savings} className="pageImg"/>
             <p>{this.state.wtso}</p>
             <img src="https://admin.wtso.com/images/5f8f091a00560.png" />
            </div>
        );
    }
}

export default Savings;
